// a home page
import React from 'react';
import './ErrorPage.css';

function ErrorPage() {

    return (
        <div className="App">
            <header className="App-header">
                <h1>Welcome to Stepwise Source, where you can easily present your code.</h1>
                <button className="button" onClick={() => window.location.href = "/newDemo"}>Create a new presentation</button>
                <button className="button" onClick={() => window.location.href = "/demo/1"}>Tutorial on how to create your own presentation</button>
            </header>
        </div>
    );
}

export default ErrorPage;
